  \"2015-08-21T22:42:26.281921\",\n\t\"name\": \"my-healthevet-mhv\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"My HealtheVet (MHV) is VA's award-winning
  online Personal Health Record (PHR), located at www.myhealth.va.gov. The mission
  of MHV is to transform the  delivery of health and health care for all Veterans,
  independent of where they receive care, by providing one-stop, online access to
  better manage their overall health, make informed health decisions, and record and
  store important health and military history information. MHV provides access to
  VA health care and information 24/7 through web-based tools that empower Veterans
  to become active partners in their health care.  MHV registrants can click a 'Blue
  Button' on the website to view, print or download their available personal health
  information and military service information. They can choose to share that information
  with other providers, caregivers, family members or job advocates safely, securely,
  and privately.  Web technology combines essential health record information enhanced
  by online health resources. This enables and encourages patient/clinician collaboration.
  The online environment maps closely to existing clinical business practices and
  extends management and delivery of care.  MHV allows VA patients to request and
  receive VA prescription refills and provides a blended history of VA and self-entered
  medications.  Registrants whose personal identities have been verified as VA patients
  can receive copies of select VA electronic health records, including VA Appointments,
  Chemistry/Hematology Lab Results, Allergies and Wellness Reminders.  Many VA patients
  are communicating with their participating health care teams through Secure Messaging.\",\n\t\"license_title\":
